import React from 'react';
import { useSelector } from 'react-redux';
import {Row, Col, Steps, Tabs} from 'antd';
import styled from 'styled-components';

import AppLayout from '../components/AppLayout';
// import PostForm from '../components/PostForm';
// import PostCard from '../components/PostCard';

const TowerViewSection = styled.div`
  position: relative;
  background : #F6F7F9;
  max-width: 1350px;
  height: 87vh;
  margin: 0 auto;
  padding-top: 30px;
  padding-left: 30px;
  padding-right: 30px;
`;

const SettingSection = styled.div`
  position: relative;
  margin: 0 auto;
  padding-top: 30px;
  padding-left: 60px;
  padding-right: 60px;
`;

const Home = () => {
  // const { isLoggedIn } = useSelector(state => state.user);
  // const { mainPosts } = useSelector(state => state.post);

  return (
    <AppLayout>
      <Row>
        <Col flex="auto">
          <TowerViewSection>HI_00</TowerViewSection>
        </Col>
        <Col flex="450px">
          <SettingSection>
          <Tabs>
            <Tabs.TabPane title="Step 1" />
            <Steps.TabPane title="Step 2" />
            <Steps.TabPane title="Step 3" />
          </Tabs>
          </SettingSection>
        </Col>
      </Row>
    </AppLayout>
  );
};

export default Home;
